import React, { Component } from 'react';
import Todos from './components/Todos';
import './App.css';

class App extends Component {
  state = {
    todos: [
      {
        id: 1,
        title: 'take a shower',
        completed: true
      },
      {
        id: 2,
        title: 'do the laundry',
        completed: false
      },
      {
        id: 3,
        title: 'make breakfast',
        completed: true
      }
    ]
  }

  render() {
    return (
      <div style={{textAlign: 'center'}}>
        <h1>ToDo App</h1>
        <Todos todos={this.state.todos} />
      </div>
    )
  }
}

export default App;
